import { Button, Col, Row } from 'react-bootstrap';
import React from 'react';
import '../App.css';

export default function Welcome() {
  return (
   <Col lg="4" className='pt-2 pb-2 mb-5  rounded segundoColor '>

        <Row className='bg-primary'>

        <Col xs lg="12" className='segundoColor'>
        <p className='text-dark mt-3 h5 text-center '>Bienvenido Gabriel{sessionStorage.getItem('Username')}</p>
        <Button  variant='danger' className='text-center rounded-pill mb-1'>Out</Button>
        </Col>

        </Row>
   </Col>
  )
}
